//            return (<ul>{listItems}</ul>);

      const words = para.split(" ");
      const tally = {};
      for (const index = 0; index < tally.length; ++index) {
          if(tally.has(tally[index])){
            tally.set(1,tally[index]);
          }  
      }
  }

  render() {
    return (
      <div className="result">
        <strong>Summary</strong>
        {this.truncate()}
      </div>
    );
  }
}

export default Summary;
